Use ";" to separate multiple tags.
{i.e. A;B;C}

Use " > " to create hierarchical tags.
{i.e. A > B > C}

Drag-and-drop selected photos to existing tags 
on Project tab to add tag directly.

Verwenden Sie „;“ (Semikolon), um mehrere Tags zu trennen.
{d.h. A;B;C}

Verwenden Sie „>“ (spitze Klammer), um hierarchische Tags zu erstellen.
{d.h. A > B > C}

Verschieben Sie die ausgewählten Fotos auf vorhandene Tags 
auf der Registerkarte Projekt, um Tags direkt hinzuzufügen.

